import React, {memo} from 'react';
import {Routes, Route} from 'react-router-dom';

// 컴포넌트
import Main from './pages/Main';
import Header from './components/Header';
import Footer from './components/Footer';

import EmpIndex from './pages/EmploymentSupport';
import DetailPages from './pages/EmploymentSupport/DetailPages';

import FouIndex from './pages/FoundedSupport';
import FDetailPages from './pages/FoundedSupport/FDetailPages';

import MinIndex from './pages/MindSupport';

import EduIndex from './pages/EducationSupport';
import EDetailPages from './pages/EducationSupport/EDetailPage';

import MonIndex from './pages/MoneySupport';
import MoDetailPage from './pages/MoneySupport/MoDetailPage';
import CommunityPage from './pages/Community/CommunityPage';
import ListAdd from './pages/Community/ListAdd';
import ListView from './pages/Community/ListView';
import ListEdit from './pages/Community/ListEdit';
import Join from './pages/Join';

const App = memo(() => {
    return (
      <div>

        <Routes>
            <>
              <Header />
              <Route path='*' exact={true} element={<Main />} /> 
              <Route path='/index.html' element={<Main />} /> 

              <Route path='/empSupport' element={<EmpIndex />} />
              <Route path='/empSupport/:id' element={<DetailPages />} />

              <Route path='/fouSupport' element={<FouIndex />} />
              <Route path='/fouSupport/:id' element={<FDetailPages />} />

              <Route path='/minSupport' element={<MinIndex />} />

              <Route path='/eduSupport' element={<EduIndex />} />
              <Route path='/eduSupport/:id' element={<EDetailPages />} />

              <Route path='/monSupport' element={<MonIndex />} />
              <Route path='/monSupport/:id' element={<MoDetailPage />} />

              <Route path='/communityHome' element={<CommunityPage />} />
              <Route path='/communityAdd' element={<ListAdd />} />
              <Route path='/communityView/:id' element={<ListView />} />
              <Route path='/communityEdit/:id' element={<ListEdit />} />
              <Footer />
            </>
        </Routes>

      </div>
    );
});

export default App;
